                  </tr>
              </thead>
              <tbody>
                  {data.map(item => (
                  <tr key={item.id}>
                      <td>{item.id}</td>
                      <td>{item.name}</td>
                  </tr>
                  ))}
              </tbody>
              </table>
          </body>
      </html>
    );*/

    return (
        <div>
        <header>
            <button onClick={data('home')}>Home</button>
            <button onClick={data('recipe')}>Recipe</button>
        </header>
        <main>
            {data === 'home' && <HomePage />}
            {data === 'recipe' && <RecipePage />}
        </main>
        </div>
    );
}

export default App;
